import React from 'react';
import './Navbar.css';
import { Route, Routes, Navigate } from 'react-router-dom';

export default function Navbar() {
  return (
    <nav className="navbar">
      <div className="brand-logo-container">
        <h3 className="brand-logo">gciConnect</h3>
        <img 
          src="/GCISL_logo_fullcolor.png" 
          alt="Granger Cobb Institute Logo"
          className="logo"
        />
      </div>
      <div className="navbar-right">
        <ul className="nav-links">
          <Routes>
            <Route path= {"../NavBarFunctions/Contact.jsx"} element={<Contact/>} />
          </Routes>
          <li><a href="/">Home</a></li>
          <li><a href="/get-involved">Get Involved</a></li>
          <li><a href="../NavBarFunctions/Contact.jsx">Contact Us</a></li> {/* Linking to the Contact Us page */}
          <li><a href="/about" className="active">About</a></li>
          <li><a href="/login" className="login-button">Log in</a></li>
        </ul>
      </div>
    </nav>
  );
}
